Also would love to hear from you guys in the comments 🥰

First video of 2025 ✨
I’ve decided to be a bit more open about things & the best way was to address one of my biggest insecurities
I think makeup has helped quite a bit to address these insecurities & make me feel a bit more confident 
This is actually the first time I’ve done this sleek hair look (trust me I dreaded it) but I think the first step to overcoming was by accepting it 

Just be kind to yourself 🫶

also I’ve used a lot of new makeup 😍 which I absolutely loved 

